result:
.hide-dialog{
  display:none;
}
.map {
 width: 100%;
 height: calc(100vh);
 overflow: hidden;
 zoom: 1;
 position: relative;
 -webkit-transition: all 0.5s ease-in-out;
 transition: all 0.5s ease-in-out;
}
.fontIcon {
 margin-left:2px;
 width: 50px;
 height: 50px;
}
.float{
    overflow: hidden;
    z-index: 9999;
    position: fixed;
    padding:5px;
    width: 300px;
    height: 50px;
    text-align: center;
    border-bottom-left-radius: 4px;
    border-bottom-right-radius: 4px;
    border-top-left-radius: 4px;
    border-top-right-radius: 4px;
    right: 35%;
    bottom: 20%;
}
